import React, { Component } from 'react';

class Weather extends Component {
  render() {
    return (
      <div className="tile">
        <div className="bar"></div>
        <div className="text">
          <div>{props.top}</div>
          <div className="tile-icon">
            <i className={props.icon + ' op'}></i>
          </div>
          <div></div>
        </div>
      </div>
    );
  }
}

export default Weather;
